import React, { useEffect, useState } from 'react'
import { 
    Container,
    Row,
    Col,
    Card,
    Button
     } from 'react-bootstrap';
import FormLogin from './Form'
import Clock from 'react-clock';

const ComponenetHome = () => {
    const [value, setValue] = useState(new Date());

    useEffect(() => {
        const interval = setInterval(
          () => setValue(new Date()),
          1000
        );
    
        return () => {
          clearInterval(interval);
        }
      }, []);

    return(
        <div>
            
            <Container fluid>
                <Row>
                    <Col sm={4}>
                        <Card style={{ width: '80vh' , height: '98vh'}}>
                                <Card.Body>
                                <div style={{height:'120px'}}></div>
                                    <Card.Title style={{fontFamily:'fantasy', fontSize:'90px'}}>FACILITY - STORE</Card.Title>
                                    <Card.Title style={{paddingLeft:'400px'}}>Project By U</Card.Title>

                                    <div style={{height:'480px'}}>
                                        
                                    </div>
                                            <Col style={{paddingRight:'80px'}}>
                                                <FormLogin />
                                            </Col>
                                </Card.Body>
                        </Card>
                    </Col>
                    <Col sm={6}>
                        <Clock value={value} />
                    </Col>
                </Row>
                    

            </Container>

        </div>
    )
}

export default ComponenetHome
